// React
import React from "react";
import MenuCollections from "./MenuCollections";
import MenuInstallations from "./MenuInstallations";

function Home({ splashImages, collections, installations, isLoading }) {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        position: "absolute",
        top: "64px",
        left: "0px",
        right: "0px",
        bottom: "0px",
        padding: "32px",

        background: "#f8f8f8",
      }}
    >
      <div>
        <MenuCollections collections={collections} isLoading={isLoading} />
        <MenuInstallations
          installations={installations}
          isLoading={isLoading}
        />
      </div>
      <img
        src={splashImages}
        style={{
          width: "50%",
          objectFit: "cover",
        }}
      ></img>
    </div>
  );
}

export default Home;
